import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';


class InputComponent extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            txt: ''
        }
        // this.handle = this.handle.bind(this)

    }

    handle(e) {
        this.setState({
            txt: e.target.value
        })
    }

    render() {
        return (
            <div>
                <input type="text" value={this.state.txt} onChange={this.handle.bind(this)}/>
            </div>)
    }
}

const headingTitle = <h1>SignUp Page</h1>;

function formComponent() {
    return (
        <div>
            <form>
                {new InputComponent({txt: "enter your name her"})}
                {new InputComponent({txt: "email here"})}
                {Button}
            </form>
        </div>
    );

}

const Button = (
    <button>
        Sign Up
    </button>
);


function App() {
    return (
        <div>
            {headingTitle}
            {/*{formComponent()}*/}
        </div>)
}


export default App;
